prompt_example:
ναι επειδή σίγουρα είχε περάσει από το μύλο αλλά Δικαιούμαστε να πούμε ότι "Μπράβο, τα κατάφερε αναίμακτα!"; Ναι, όχι, ή ίσως;
Οχι

Εγώ, με τη σειρά μου, τυχαίνει να έχω επιθυμίες τέτοιες ώστε να είμαι πιο ευτυχισμένος με αρκετά περισσότερα αχλάδια από ότι μήλα. Δικαιούμαστε να πούμε ότι "Θα προτιμούσα να έχω 10 αχλάδια παρά 10 μήλα."; Ναι, όχι, ή ίσως;
Μπορεί

Το Limpiar σημαίνει να καθαρίσει, και μια limpia είναι παρόμοια με μια barrida. Δικαιούμαστε να πούμε ότι "Το Limpiar σημαίνει να χορεύεις."; Ναι, όχι, ή ίσως;
Οχι

Στο φυσικό περιβάλλον, η εικόνα, η μετάλλαξη, ο ανασυνδυασμός και η επιλογή μπορούν να συνωμοτήσουν για να τραβήξουν τους εξελισσόμενους πληθυσμούς προς τα πάνω προς τις κορυφές της υψηλής φυσικής κατάστασης. Δικαιούμαστε να πούμε ότι "Σε υψηλότερα επίπεδα φυσικής κατάστασης, οι πληθυσμοί που εξελίσσονται είναι πιο πιθανό να επιβιώσουν."; Ναι, όχι, ή ίσως;
Μπορεί

ναι και εμείς απλά κάναμε εεε, κάπως εεε, ήταν ένα πάρτυ γενεθλίων έκπληξη γι' αυτήν ήταν αυτό που ήταν Δικαιούμαστε να πούμε ότι "Της άρεσε πολύ το πάρτι έκπληξη."; Ναι, όχι, ή ίσως;
Μπορεί

Στο ξέσπασμα του πολέμου, η φήμη του Καναδά για την υποδοχή μεταναστών και προσφύγων από όλο τον κόσμο αμαυρώθηκε από τον αποκλεισμό των κομμουνιστών και των Εβραίων από τη Γερμανία του Χίτλερ. Δικαιούμαστε να πούμε ότι "Ο Καναδάς δεν έχει υποδεχθεί ποτέ πρόσφυγες."; Ναι, όχι, ή ίσως;
Οχι

Λοιπόν, δεν το σκέφτηκα καν, αλλά ήμουν τόσο απογοητευμένος, και κατέληξα να του μιλάω και πάλι. Δικαιούμαστε να πούμε ότι "Δεν του μίλησα ξανά."; Ναι, όχι, ή ίσως;
